import React from 'react';

class showAndHide extends React.Component {

  state = {
      divcontainer:false,
  }

  render() {

    var handleChange = e => {
      this.setState({divcontainer:!this.state.divcontainer})
    }

    return(
      <div>
        <button onCLick={handleChange}>
          Show
        </button>
        {
        <p>Purpose Text Blurb</p>
        }
      </div>

    );
  }

}

export default showAndHide;
